import styled from "styled-components";

const Input = styled.input`
   order: 1px solid #fff;
   background: transparent;
    border: 1px solid #FFF;
    padding 20px 140px;
    width: 200px;
    color: #FFF;
    font-size: 16px;
    
    &::placeholder {
     color: #FFF;
     font-size: 16px
    }
   

`


export default Input
